import React from 'react';
import * as Calculate from './Calculate'; // Calculate.js에서 모든 함수를 가져옵니다.

function Result() {

const score = Calculate.calculateScore(1, '가끔'); // 예시로 questionId와 value를 전달

return (
  <div>
    <h1>결과</h1>
    <div> 총 점수 : {score} </div>
  </div>
);
}

export default Result;
